import React from "react";

function StopButtonHandler ({type, className, dataTestId, title, spanClass}) {

    return (
        <button
        type="button"
        className="btn btn-secondary"
        data-testid="stop"
        title={title}
        >
            <span className={spanClass} />
        </button>
    );
}

export default StopButtonHandler;
